import React, {useState} from "react";

const Form = () => {
    const [name, setName] = useState('')
    const [email, setEmail] = useState('')

    return (
        <form>
            <div>
                <h1>React</h1>
                <label>Name: </label>
                <input type='text'/>
                <br/><br/>

                <label>Email: </label>
                <input type='email'/>
                <br/><br/>

                <label>Password: </label>
                <input type='password'/>
                <br/><br/>

                <button>Submit</button>
            </div>
        </form>
    )
}

export default Form
